import React from 'react';

const TodoList = ({ tasks, course, category }) => {
  return (
    <ul>
      {tasks.length === 0 ? (
        <li>No tasks added yet for {category}.</li>
      ) : (
        tasks.map((task, index) => <li key={index}>{task}</li>)
      )}
    </ul>
  );
};

export default TodoList;
